import ResizeMixin from '@/layout/mixin/ResizeHandler'

export default {
  name: "Page404",
  data(){
    return {
      device:""
    }
  },
  created(){
    this.device = this.$store.state.app.device;
  },
  mixins: [ResizeMixin],
  computed: {
    message() {
      return "网站管理员说您无法进入此页面...";
    },
    deviceVal() {
      return this.$store.state.app.device;
    }
  },
  watch:{
    deviceVal(newVal, oldVal){
      this.device = newVal;
    }
  }
};
